  `content` longtext COMMENT '文章内容',
  `photo` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '本地图',
  `photo_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '网图（有网图优先网图）',
  `photo_shot` varchar(255) DEFAULT NULL COMMENT '略缩图\r\n',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `type` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `user_id` bigint NOT NULL COMMENT '文章创建人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `version` int DEFAULT '1',
