  `rate` decimal(10,2) DEFAULT '0.00',
  `rate_num` int DEFAULT '0',
  `type2` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '同种门类',
  `photo_list` json DEFAULT NULL COMMENT '商品的轮播图列表',
  `love_list` json DEFAULT NULL COMMENT '点赞列表',
  `visible` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
