  `is_top` tinyint DEFAULT '0' COMMENT '是否置顶',
  `is_show` tinyint DEFAULT '0' COMMENT '是否可见',
  `is_on_homepage` tinyint DEFAULT '0' COMMENT '是否主页显示\r\n',
  `biaoqian` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `price` (`price`) USING BTREE,
  KEY `creator` (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1838170795306647555 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
