INSERT INTO `t_product` VALUES (45698,'友链',NULL,0,NULL,'','noproduct',NULL,NULL,'1999-01-01 23:58:30','0',1784369102748491777,'2024-08-15 03:16:25',1,9,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(45699,'关于我',NULL,0,NULL,'## 一些导航\n- [关于我](./about)\n- [关于本博客](./product?id=1834993770874068994)\n- [关于项目](./product?id=1826979706201747458)\n\n\n## 不知道写啥??\n\n\n额，让我想想\n\n- 男的，活的，半个编程爱好者\n\n- 精通CV（ctrl c + ctrl v）\n\n- ~~GPT~~~~claude~~大自然的搬运工\n\n- ?猫单恋者\n- 喜欢创造，建造（从之前的cs地图，到环世界城市天际线种田游戏，再到~~肝帝模拟器~~编程）\n-每天为了某个崇高的目标往山顶堆石块的感觉真是让人欲罢不能？\n\n以后想到啥再补充\n\n\n\n（ps：有bug可以在下面说）\n\n<div style=\"display:flex;margin-top:20px;\">\n\n\n<a style=\"width:32px;height:32px;border-radius:16px;background-image:url(\'https://github.githubassets.com/favicons/favicon.svg\');\" href=\"https://github.com/hhhhhhos\" target=\"_blank\">\n</a>\n\n\n<div style=\"width:30px;\"></div>\n\n<a style=\"width:32px;height:32px;border-radius:16px;background-image:url(\'https://g.csdnimg.cn/static/logo/favicon32.ico\');\" href=\"https://blog.csdn.net/weixin_51140667\" target=\"_blank\">\n</a>\n\n</div>\n\n\n\nEND\n---\n','noproduct',NULL,NULL,'2024-08-22 12:28:59','0',1784369102748491777,'2024-09-16 05:43:15',1,10,0,0.00,0,NULL,NULL,'[]',NULL,NULL,0,1,0,NULL),(1803052557640171521,'我在人名广场吃着炸鸡',1.00,0,'','# 一级标题\n123123\n1. 123123\n2. 213\n## 二级标题\n- 123\n- 2123\n-[百度](www.baidu.com)\n\n```Java\nimport java.util.*;\nimport java.util.stream.Collectors;\n\n@RestController\n@RequestMapping(\"/product\")\n@Slf4j // 自动生成log对象\npublic class ProductController {\n    @Autowired\n    ProductMapper productmapper;\n\n    @Autowired\n    DataResultMapper dataResultMapper;\n\n    @Autowired\n    ProductRateMapper productRateMapper;\n\n    @Autowired\n    GlobalProperties globalProperties;\n\n    @Autowired\n    ObjectMapper objectMapper;\n\n    @GetMapping(\"/page\") // 分页查询 接收params //防空设默认\n    public R<Page> FindPageProduct(@RequestParam Map<String,String> params){\n        //log.info(\"!!:{}\",FType);\n        try {\n\n            int currentPage = Integer.parseInt(params.get(\"currentPage\"));\n            int PageSize = Integer.parseInt(params.get(\"PageSize\"));\n            String FName = params.get(\"FName\");\n            String FType = params.get(\"FType\");\n            String value2 = params.get(\"value2\");\n\n            LambdaQueryChainWrapper<Product> query = new LambdaQueryChainWrapper<>(productmapper);\n\n            // 空参数抛异常\n            if(currentPage == 0 || PageSize == 0 )throw new CustomException(\"分页查询参数为空\");\n            // 分页查询\n            Page page = new Page<>(currentPage, PageSize);\n\n            // FName不为空 筛选名字\n            if(FName != null)query.like(Product::getName,FName);\n            // FType不为空 筛选种类\n            if(FType != null)query.eq(Product::getType,FType);\n\n            if(value2 != null){\n                PageQueryValue2(query, value2);\n            }\n\n\n\n\n            // 执行查询\n            page = query.page(page);\n\n            /*\n            //控制台打印json\n            Gson gson = new GsonBuilder().setPrettyPrinting().create();\n            String json = gson.toJson(res);\n            System.out.println(json);\n            //\n            */\n            log.info(\"分页查询成功\");\n            // 访客加一\n            DataResult dataResult = dataResultMapper.selectById(45698);\n            dataResult.setHome_visitors(dataResult.getHome_visitors()+1);\n            dataResultMapper.updateById(dataResult);\n            // 加点参数\n            List<Product> res = page.getRecords();\n            List<Map<String,Object>> nres = res.stream().map(product -> {\n                Map<String,Object> entry = new HashMap<>(objectMapper.convertValue(product, Map.class));\n                entry.put(\"comment_num\",Db.lambdaQuery(Comment.class)\n                        .eq(Comment::getProduct_id,product.getId())\n                        .count());\n                return entry;\n            }).collect(Collectors.toList());\n            page.setRecords(nres);\n\n            return R.success(page).add(\"home_visitors\",dataResult.getHome_visitors());\n        }catch(Exception e){\n            log.info(\"分页查询失败：{}\",e.getMessage());\n            return R.error(e.getMessage());\n        }\n\n\n    }\n\n\n```\n\n456456\n### 三级标题\n\n# 一级标题\n','noproduct','https://pic3.zhimg.com/v2-ca536af013b00504265419546f5bcb72_r.jpg','3T3EEI_202407040751','2024-06-18 21:10:04','2',1784369102748491777,'2024-07-28 07:20:47',525,0,0,0.00,0,NULL,NULL,'[]',NULL,NULL,1,1,0,NULL),(1806744849118928897,'最喜欢的壁纸之一',1.00,0,'','::: hljs-center\n\n![](https://pic3.zhimg.com/v2-ea606c20b4f2851ba02f5a7c1235550a_r.jpg)\n\n:::\n\n为什么一个程序猿也能画出这么美的画 关键还是男的???\n\nwlop yyds!\n\n\n\n\n','noproduct','https://pic3.zhimg.com/v2-ea606c20b4f2851ba02f5a7c1235550a_r.jpg',NULL,'2024-06-29 01:41:54','2',1784369102748491777,'2024-07-25 12:09:35',1,0,0,0.00,0,NULL,NULL,'[]',NULL,NULL,0,1,1,NULL),(1816998428983533570,'【BLOG】视屏内嵌实验',NULL,0,NULL,'<iframe src=\"https://player.bilibili.com/player.html?isOutside=true&aid=1456314252&bvid=BV1Qi421h7Tf&cid=1625529011&p=1&high_quality=1\" scrolling=\"no\" border=\"0\" frameborder=\"no\" framespacing=\"0\" allowfullscreen=\"true\" width=\"100%\" height=\"600\" ></iframe>\n\n测试视频功能\n\n<mavon-editor :toolbars=\"markdownOption\"\n                ref=\"editor\" @imgAdd=\"$imgAdd\" @imgDel=\"$imgDel\"  v-model=\"dialogdata2.content\"\n                :xssOptions=\"xssOptions\">\n\n            xssOptions: {\n                whiteList: {\n                    a: [\"href\", \"title\", \"target\", \"download\"],\n                    img: [\"src\", \"alt\", \"width\", \"height\"],\n                    video: [\"src\", \"type\", \"controls\", \"width\", \"height\", \"poster\"],\n                    source: [\"src\", \"type\"],\n                    br: [],\n                    div: [\"class\",\"style\"],\n                    iframe: [\"style\",\"src\", \"scrolling\", \"border\", \"frameborder\", \"framespacing\", \"allowfullscreen\",\"width\", \"heigh