。日本80年代泡沫破裂时的同款年轻人。\n我也不关心时局了，说实话，自己独处久了爽是爽，就是有一点点孤独，所以写一写日记吧，我想到了以后，连续访问本站多少天的老粉，可以解锁日记，哈哈哈哈哈！?\n\n> 估计还是永远不会解锁?\n\n### 聊自己。。\n\n辞职银行，二学位两年，找工作全军覆没，可能一是看你有辞职怕你又跑，二是经济不行，三是学校不行，哈哈。\n准备must继续两年mphil，谁知道未来呢。总感觉must这个辣鸡学校会要我这种，有点杀猪盘?，虽然是不错的专业。（学费也确实贵，虽然不用我花钱）8月2几号报道来着，8月26号，也不知道以后会怎么样，到时再说吧，对我来说怎样都一样，，哈哈哈，怎样都是过。能喝可乐，吃汉堡，链接仙人就吃喝嫖不赌?。\n\n准备睡了，毕业找不到工作就找不到吧~yo，我去楼下喂猫咯，转一圈回来睡觉\n\n### seeU\n\n4:10am\n\n','noproduct',NULL,NULL,'2024-08-12 03:32:01','6',1784369102748491777,'2024-08-12 04:11:07',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,0,0,NULL),(1822948608975167490,'【VUE】await promise',NULL,0,NULL,'await\n```JavaScript\nasync fetchData() {\n            try {\n                const response = await axios.get(\'https://api.example.com/data\');\n                return response.data; // 返回请求的数据\n            } catch (error) {\n                console.error(\'请求出错:\', error);\n                throw error; // 如果出错，抛出异常\n            }\n        },\n        async loadData() {\n            try {\n                this.data = await this.fetchData(); // 等待 fetchData 返回结果，并将其赋值给 data\n                console.log(\'收到的数据:\', this.data);\n            } catch (error) {\n                console.error(\'加载数据时出错:\', error);\n            }\n        }\n```\n\npromise\n```JavaScript\nfetchData() {\n            return new Promise((resolve, reject) => {\n                axios.get(\'https://api.example.com/data\')\n                    .then(response => {\n                        resolve(response.data); // 请求成功时，解析 Promise 并返回数据\n                    })\n                    .catch(error => {\n                        console.error(\'请求出错:\', error);\n                        reject(error); // 请求失败时，拒绝 Promise 并返回错误\n                    });\n            });\n        },\n        loadData() {\n            this.fetchData()\n                .then(data => {\n                    this.data = data; // 成功获取数据后，将其赋值给 this.data\n                    console.log(\'收到的数据:\', this.data);\n                })\n                .catch(error => {\n                    console.error(\'加载数据时出错:\', error);\n                });\n        }\n```','noproduct',NULL,NULL,'2024-08-11 10:49:52','1',1784369102748491777,'2024-09-09 00:41:53',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1822955519963422721,'【思路】vue登录确权笔记',NULL,0,NULL,'自己搞的确权逻辑……怕忘了记一下\n\nrouter.beforeEach\n---\n路由前置守卫判断store全局变量，没登录 且不在白名单 就跳login\n```JavaScript\n// login\n    if(!store.state.IsLogin && !allowedPaths.includes(to.path)){\n        console.log(\"未登录\")\n        next(\'/login\')\n    }\n```\n\nstore\n---\n全局变量默认true防止刷新闪跳（刷新未登录跳login确权又跳回）\n\n```JavaScript\n\nstate: {\n        IsLogin : true,\n\n```\n\n\n较前面的父组件index.vue 里的mounted()\n---\n\n就是在组件初始化时，向服务器询问是否登录，\n登录全局true\n没登录 全局false 就看是否在路径白名单，不在拉回登录页\n\n```JavaScript\naxios.get(\'/user/name\')\n            .then(response=>{\n                if(response.data.code){\n                    this.$store.state.IsLogin = true\n                    ...\n                }else{\n                    this.$store.state.IsLogin = false\n                    ...\n                    if(!allowedPaths.includes(this.$route.path)){\n                        this.$router.push(\'/login\')\n                    }\n                }\n            })\n```','noproduct',NULL,NULL,'2024-08-12 11:17:19','1',1784369102748491777,'2024-09-09 00:40:26',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1823878980923580418,'小说狗血剧本',NULL,0,NULL,'“什么？你今年刚毕业，儿子都十岁了？”\n---\n\n这事说来话长，高三的时候我不小心搞大了同桌的肚子，学校一怒之下将我退学。我愧对同桌，抛下她和儿子飞往美国念大学研究生。\n\n出国研究生归国之后，那个女孩找上了我，同时也带着我十岁的儿子。\n\n咖啡厅里，她对我说，我本来可以接收她爷爷的十亿遗产，考验就是看我能不能面对突如其来的孩子，仍然对他孙女不离不弃。\n\n谁知你小子远走高飞了，爷爷对你我大失所望，遗产目前将给爷爷的小孙子继承。\n\n“你父母呢，都死了？没继承权”\n\n“是的，听爷爷说妈在生我的时候就难产死了，爸承受不住打击跳楼了”\n\n于是，我和我的高中同桌组成统一战线，决定在爷爷死前，向小孙子发起十亿遗产争夺战\n---\n\n小孙子为了继承十亿，大义灭亲，三番五次对我们展开暗杀\n\n就在我和同桌被小孙子逼上绝路时玩完时，我和小孙子却陷入了爱河，多次相爱相杀产生特别情愫\n\n因为丢人，爷爷断绝了小孙子金钱援助，转而资助我同桌\n\n亲情爱情双背叛，我的同桌当场化身女强人向我两负心汉发起猛烈复仇\n\n\n于是，我又和小孙子组成统一战线，向我同桌发起十亿遗产争夺战\n---\n\n资本就是力量，就在我和小孙子命悬一线时，小保姆爆料同桌其实不是爷爷的孙子！\n而是爷爷的男宠和自己偷情的孩子！！\n干！！爷爷原来也是gay！！！\n爷爷只好坦白自己是gay，并解释说家族染色体R遗传缺失，导致家族全部男性都是gay，没办法\n\n> 就这样，没血缘关系的同桌退出了竞赛，小孙子夺得了十亿遗产，而我准备和他结婚\n\n就在我们沉浸在金钱和~~基情~~爱情的喜悦中时，却在婚前体检中突然得知我的染色体R也有缺失！？\n原来我是爷爷的第三孙子？？！\n\n这件事不知怎么传到了小孙子那里，为了十亿，联盟再次决裂，而小孙子为了对付我，拉拢了自己没血缘关系的姐姐，因为她最了解我，并许诺事成之后三七分\n\n于是，小孙子又和我同桌组成统一战线，向我发起十亿遗产争夺战\n---\n\n暗杀三百回合之后，不分伯仲，小孙子也纳闷哪里自己哪里冒出来的兄弟，问爷爷，爷爷支支吾吾表示不清楚，我也纳闷自己的身世。遂明牌，决定带爷爷血清认证\n\n认证结果出来后，不是血亲！\n\n众人纳闷，不是血亲，为什么会有染色体R缺失呢？\n小孙子察觉事有蹊跷，验证自己和爷爷，也不是血亲！\n\n众人大蒙，老爷子眼见无法隐瞒，遂坦白，是他的男宠染色体R缺失，他自己只是为了掩盖自己是真gay和ed的尴尬。\n然后就把保姆，男宠，和我们三个都逐出了家门，自己找新男宠去了。\n\n留下我们煮熟的十个亿飞了三兄妹和一家人在风中凌乱。\n\nEND\n\n\n','noproduct',NULL,NULL,'2024-08-15 08:26:50','2',1784369102748491777,'2024-08-15 10:02:15',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,0,0,NULL),(1824067292766429186,'【BLOG】【思路】博客开发思路笔记',NULL,0,NULL,'头像\n---\n一般头像在headimg组件里\n优先级是 Wechat_headimgurl ==>== email 如果qq@.com拉取qq头像 ==>== 默认头像\n\n友链头像\n---\navata_url ==>== qq_mail拉取qq头像\n\n友链\n---\n链接默认要输入https://\n\nqq邮箱输不输入@qq.com都会拉取\n\n只有标题和博客url是必填\n\n本人和管理员可删除fan友链\nvisitor无权删除\n管理员可添删follow友链\n\ninvalid默认为1，就是不显示，要管理员手动修改\n\n友链卡组件\n---\n点名字或姓名，本人跳user/info/details 非本人跳/user/otheruserinfo\n\n爬取某站图床\n---\n> python zhihu2.py https://zhuanlan.zhihu.com/p/717394829\n\nzhihu2.py改进zhihu.py\n因为set是乱序？用列表好点','noproduct',NULL,NULL,'2024-08-15 12:55:07','1',1784369102748491777,'2024-09-09 00:40:11',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,0,0,NULL),(1824560637938786306,'这小黑怎么变得这么胖了?',NULL,0,NULL,'以前\n---\n![](https://pic2.zhimg.com/v2-ea4092aee2a80dd3c74fd1514538fafd_r.jpg)\n\n喂了一周\n------------\n![](https://pic3.zhimg.com/v2-7e253330d3b45915b4789fd0e445a8ae_r.jpg)\n\n现在??\n-----\n![](https://pic4.zhimg.com/v2-71d04f42330d8aa1dbad8b36b427fc0f_r.jpg)\n\n![](https://pic2.zhimg.com/v2-9d8602c73530772f2f3b59d0ee23b1e9_r.jpg)\n\n?这是怀孕了还是吃成这样的\n\n\n','noproduct','https://pic2.zhimg.com/v2-9d8602c73530772f2f3b59d0ee23b1e9_r.jpg',NULL,'2024-08-17 05:35:29','4',1784369102748491777,'2024-08-17 05:38:36',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,1,NULL),(1824562456723218434,'喂猫周记 0811-0817',N