ooth; /* 锚点平滑 */\n  scroll-padding-top: 50%; /* 锚点距离顶部 */\n}\n\n\n\n','noproduct',NULL,NULL,'2024-08-23 08:50:40','1',1784369102748491777,'2024-09-09 00:38:54',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1826964428596301825,'【java】非空判断ObjectUtils.isEmpty(',NULL,0,'最智能最全非空判断','org.springframework.util\n\nGPT 4o\n---\n> Spring Framework的org.springframework.util.ObjectUtils类也提供了一些实用方法来简化对对象是否为空的判断。这个类的isEmpty方法可以检查数组、集合（如List、Set）、Map和字符串是否为空。它的功能与Apache Commons Lang和Google Guava类似，但更为全面。\n\n使用Spring的ObjectUtils\n首先，确保你已经添加了Spring Core的依赖（如果你使用Maven）：\n\n<dependency>\n    <groupId>org.springframework</groupId>\n    <artifactId>spring-core</artifactId>\n    <version>5.3.21</version>\n</dependency>\n然后，你可以使用以下代码：\n\n```Java\n\nimport org.springframework.util.ObjectUtils;\n\nimport java.util.Collection;\nimport java.util.Map;\n\npublic class Main {\n    public static void main(String[] args) {\n        Object yaunsuListMap = // 获取对象\n\n        if (ObjectUtils.isEmpty(yaunsuListMap)) {\n            System.out.println(\"yaunsuListMap is empty or null\");\n        } else {\n            System.out.println(\"yaunsuListMap is not empty\");\n        }\n    }\n}\n\n```\nObjectUtils.isEmpty 方法的实现\nSpring的ObjectUtils.isEmpty方法实现如下：\n```Java\npublic static boolean isEmpty(@Nullable Object obj) {\n    if (obj == null) {\n        return true;\n    }\n    if (obj instanceof CharSequence) {\n        return ((CharSequence) obj).length() == 0;\n    }\n    if (obj.getClass().isArray()) {\n        return Array.getLength(obj) == 0;\n    }\n    if (obj instanceof Collection) {\n        return ((Collection<?>) obj).isEmpty();\n    }\n    if (obj instanceof Map) {\n        return ((Map<?, ?>) obj).isEmpty();\n    }\n    return false;\n}\n\n```\n解释：\nobj == null：检查对象是否为null，如果是null，返回true。\nobj instanceof CharSequence：如果对象是字符串，检查字符串长度是否为0。\nobj.getClass().isArray()：如果对象是数组，检查数组长度是否为0。\nobj instanceof Collection：如果对象是集合类型（如List、Set等），检查集合是否为空。\nobj instanceof Map：如果对象是Map类型，检查Map是否为空。\n通过这种方式，你可以使用Spring的ObjectUtils.isEmpty方法来简化对对象是否为空的判断，无论它是null、字符串、集合、Map还是数组。\n\n总结\nSpring的ObjectUtils.isEmpty方法确实能够进行数组、集合、Map等的长度非零判断，并且它的实现非常简洁和高效。如果你的项目已经依赖了Spring Framework，可以直接使用ObjectUtils.isEmpty方法来进行各种对象的空判断。','noproduct',NULL,NULL,'2024-08-23 20:47:18','1',1784369102748491777,'2024-09-09 00:38:27',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1826979315154202626,'【java】Stream流小计',NULL,0,NULL,'```Java\npage = allMapper.selectpagebyadminWithSearch_SetList(page, yaunsuListMap, biao, value2);\n            // 处理时间字符串\n            page.setRecords(page.getRecords().stream().map(item->{\n                Map<String,Object> map = objectMapper.convertValue(item, Map.class);\n                map.put(\"create_time\",map.get(\"create_time\").toString().substring(0,19));\n                map.put(\"update_time\",map.get(\"update_time\").toString().substring(0,19));\n                return map;\n            }).toList());\n            return R.success(page);\n```\n','noproduct',NULL,NULL,'2024-08-23 21:46:27','1',1784369102748491777,'2024-09-09 00:38:21',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1826979706201747458,'关于项目',NULL,0,'（持续更新）做着玩的项目汇总','# 目录\n> 按结束时间先后排序，时间计算不完全准确（day）\n<span style=\"display:inline-block; width:150px;\">\n肝帝 </span>?时间99+\n<span style=\"display:inline-block; width:150px;\">\n一般  </span>?时间30+\n<span style=\"display:inline-block; width:150px;\">\n不肝 </span>?时间10+\n<span style=\"display:inline-block; width:150px;\">\nGPT一天搞定 </span>?时间3+\n\n<br>\n2024\n<br><br>\n\n<div style=\"display:flex;width:95%;\">\n?<a style=\"margin-left:10px;\"  href=\"#myid_1\">新博客</a> \n<div style=\"margin-left:auto;\">\n2024/06/18 - <span style=\"color:transparent;\">2024/06/18</span>\n</div>\n</div>\n\n<div style=\"display:flex;width:95%;margin-top:10px\">\n?<a style=\"margin-left:10px;\" href=\"#myid_2\">自制网盘2</a> \n<div style=\"margin-left:auto;\">\n2024/08/01 - 2024/08/02\n</div>\n</div>\n\n<div style=\"display:flex;width:95%;margin-top:10px\">\n?<a style=\"margin-left:10px;\" href=\"#myid_3\">siri接入gpt</a> \n<div style=\"margin-left:auto;\">\n2024/07/14 - 2024/07/15\n</div>\n</div>\n\n<div style=\"display:flex;width:95%;margin-top:10px\">\n?<a style=\"margin-left:10px;\" href=\"#myid_4\">siri唤醒电脑/查询是否开机</a> \n<div style=\"margin-left:auto;\">\n2024/07/13 - 2024/07/14\n</div>\n</div>\n\n<div style=\"display:flex;width:95%;margin-top:10px\">\n?<a style=\"margin-left:10px;\" href=\"#myid_5\">自制网盘1</a> \n<div style=\"margin-left:auto;\">\n2024/07/01 - 2024/07/10\n</div>\n</div>\n\n<div style=\"display:flex;width:95%;margin-top:10px\">\n?<a style=\"margin-left:10px;\" href=\"#myid_6\">席巴商城</a> \n<div style=\"margin-left:auto;\">\n2024/01/01 - 2024/05/10\n</div>\n</div>\n\n<br>\n2023\n<br>\n\n\n<div style=\"display:flex;width:95%;margin-top:10px\">\n?<a style=\"margin-left:10px;\" href=\"#myid_7\">旧博客</a> \n<div style=\"margin-left:auto;\">\n2023/09/01 - 2024/02/10\n</div>\n</div>\n\n<div style=\"display:flex;width:95%;margin-top:10px\">\n?<a style=\"margin-left:10px;\" href=\"#myid_8\">链家房租爬虫，百度地图展示</a> \n<div style=\"margin-left:auto;\">\n2023/11/01 - 2023/12/10\n</div>\n</div>\n\n<div style=\"display:flex;width:95%;margin-top:10px\">\n?<a style=\"margin-left:10px;\" href=\"#myid_9\">GPT桌面端Win（pyqt5）</a> \n<div style=\"margin-left:auto;\">\n2023/06/01 - 2023/09/10\n</div>\n</div>\n\n<div style=\"display:flex;width:95%;margin-top:10px\">\n?<a style=\"margin-left:10px;\" href=\"#myid_10\">骑马与砍杀静态页</a> \n<div style=\"margin-left:auto;\">\n2022/12/20 - 2023/02/10\n</div>\n</div>\n\n<br>\n2019\n<br>\n\n\n<div style=\"display:flex;width:95%;margin-top:10px\">\n?<a style=\"margin-left:10px;\" href=\"#myid_11\">自制电音</a> \n<div style=\"margin-left:auto;\">\n2019/07/15 - 2019/07/15\n</div>\n</div>\n\n\n<br>\n\n# 汇总\n\n> 下面是汇总\n\n<br>\n\n## 新博客<a id=\"myid_1\"></a>\n- 详情：[关于本博客](./product?id=1834993770874068994)\n- 仓库：[https://github.com/hhhhhhos/NewBlog](https://github.com/hhhhhhos/NewBlog)\n- 地址：[https://yjztest.top/xiba-newblog/](https://yjztest.top/xiba-newblog/)\n\n用户页vue和element，vant组件手撸，管理页套了vue-admin-template，后台Springboot\n（把毕设的商城直接拿来改改就成博客了???）\n\n**20240831**\n- 做管理页时，发现前面写的那些页和接口其实不用写这么多，后台用xml泛型查询针对不同表就方便许多?（偷大懒）\n- 把页面组件化传每个表参数就行\n\n<br>\n\n## 自制网盘2<a id=\"myid_2\"></a>\n\n基本解决我上传文件到电脑的需求了（其实微信文件上传助手也可以?，只是视频压码率）\n<iframe src=\"https:////player.bilibili.com/player.html?isOutside=true&aid=113014128772362&bvid=BV1rYWReGEyX&cid=500001660159854&p=1&high_quality=1&danmaku=1&autoplay=0\" scrolling=\"no\" border=\"0\" frameborder=\"no\" framespacing=\"0\" allowfullscreen=\"true\" width=\"100%\" height=\"600\"></iframe>\n\n[源码在这](https://blog.csdn.net/weixin_51140667/article/details/140862080?spm=1001.2014.3001.5501)\n\n\n<br>\n\n## siri接入gpt<a id=\"myid_3\"></a>\n\n做着玩的，有时会用（~~根本不用~~）\n<iframe src=\"https:////player.bilibili.com/player.html?isOutside=true&aid=113014212725393&bvid=BV1dCWRevEdz&cid=500001660173022&p=1&high_quality=1&danmaku=1&autoplay=0\" scrolling=\"no\" border=\"0\" frameborder=\"no\" framespacing=\"0\" allowfullscreen=\"true\" width=\"100%\" height=\"600\"></iframe>\n\n**源码**\nopenai.api_key = \'你的key\'\nUSERNAME = \"你的名字\"\nPASSWORD = \"你的密码\"\nTOKEN = \"你的token\"\n\n**gpt5.py：**\n```python\nfrom fastapi import FastAPI, UploadFile, File, Form\nimport shutil\nimport os\nfrom fastapi import FastAPI, Request, Response, HTTPException\nfrom fastapi.responses import JSONResponse\nfrom pydantic import BaseModel\nfrom typing import List\nfrom starlette.middleware.base import BaseHTTPMiddleware\nfrom starlette.responses import JSONResponse\n\n\nclass AuthMiddleware(BaseHTTPMiddleware):\n    async def dispatch(self, request: Request, call_next):\n        # 检查请求的路径\n        if request.url.path != \"/login\":\n            # 从请求的 cookies 中获取 auth_token\n            auth_token = request.cookies.get(\"auth_token\")\n            if auth_token != TOKEN:\n                # 如果 token 不匹配，返回错误响应\n                return JSONResponse({\"message\": \"Invalid token!\"}, status_code=403)\n        \n        # 如果 token 验证通过或路径是 /login，继续处理请求\n        response = await call_next(request)\n        return response\n        \nclass CustomError(Exception):\n    def __init__(self, message=\"A custom error occurred\"):\n        super().__init__(message)\n        self.message = message\n\nimport openai\nimport requests\n\n# Set your OpenAI API key\nopenai.api_key = \'你的key\'\n\n# Define the proxy\nproxies = {\n    \'http\': \'http://127.0.0.1:7890\',\n    \'https\': \'http://127.0.0.1:7890\',\n}\n\n# Custom request function using the proxy\ndef openai_request_with_proxy(url, method=\'get\', **kwargs):\n    with requests.Session() as session:\n        session.proxies.update(proxies)\n        response = session.request(method, url, **kwargs)\n        return response\n\n# Monkey-patch the requests function in openai\'s API library\nopenai.api_requestor._requests_session = requests.Session()\nopenai.api_requestor._requests_session.proxies.update(proxies)\n\n\nclass R:\n    def __init__(self, code: int, msg: str = None, data=None):\n        self.code = code\n        self.msg = msg\n        self.data = data\n\n    @classmethod\n    def success(cls, data):\n        \"\"\"Creates a success Response object.\"\"\"\n        return cls(code=1, data=data)\n\n    @classmethod\n    def error(cls, msg):\n        \"\"\"Creates an error Response object.\"\"\"\n        return cls(code=0, msg=msg)\n\n\ndef send_req_to_openai(content, model):\n    try:\n        completion = openai.ChatCompletion.create(\n            #model=\"gpt-4o\",\n            model=model,\n            messages=[\n                {\"role\": \"system\", \"content\": \"You are a helpful assistant.\"},\n                {\"role\": \"user\", \"content\": f\"{content}\"}\n            ],\n            request_timeout=3\n        )\n        return R.success(completion.choices[0].message[\'content\'])\n    except Exception as e:\n        return R.error(e)\n\n\n\n\napp = FastAPI()\n# 注册中间件\n#app.add_middleware(AuthMiddleware)\n\nUSERNAME = \"你的名字\"\nPASSWORD = \"你的密码\"\nTOKEN = \"你的token\"\n\n\nclass UserData(BaseModel):\n    content: str\n    model: str\n    key: str\n\n\nclass UserData2(BaseModel):\n    key: str\n\n@app.post(\"/send\")\ndef login(userData: UserData):\n    if userData.key == \"uiopadfjklbn\":\n        return send_req_to_openai(userData.content,userData.model)\n\n    else:\n        return R.error(\"valid key\")\n```\n\n**gunicorn_gpt5.py：** <a id=\"gunicorn_gpt5.py\"></a>\n\n```python\nimport os\n\n# 设置守护进程\ndaemon=True\n# 监听内网端口51234\nbind=\'0.0.0.0:51234\'\n# 设置进程文件目录\npidfile=\'./gunicorn.pid\'\nchdir=\'./\' # 工作目录\n# 工作模式\nworker_class=\'uvicorn.workers.UvicornWorker\'\n# 并行工作进程数 核心数*2+1个\nworkers=3  #multiprocessing.cpu_count()+1\n# 指定每个工作者的线程数\nthreads=2\n# 设置最大并发量\nworker_connections = 200\nloglevel=\'debug\' # 错误日志的日志级别\n#access_log_format = \'%(t)s %(p)s %(h)s \"%(r)s\" %(s)s %(L)s %(b)s %(f)s\" \"%(a)s\"\'\naccess_log_format = \'%(asctime)s %(p)s %(h)s \"%(r)s\" %(s)s %(L)s %(b)s %(f)s\" \"%(a)s\"\'\n# 设置访问日志和错误信息日志路径\nlog_dir = \"./log\"\nif not os.path.exists(log_dir):\n    os.makedirs(log_dir)\naccesslog = \"./log/gunicorn_access.log\"\nerrorlog = \"./log/gunicorn_error.log\"\n\n```\n\n**linux命令:**\n\n> gunicorn gpt5:app -c gunicorn_gpt5.py\n\n<br>\n\n**快捷指令**\n[https://www.icloud.com/shortcuts/1ec9a151cf5348459838ae59850ee18f](https://www.icloud.com/shortcuts/1ec9a151cf5348459838ae59850ee18f)\n\n要不内网穿透要不挂服务器上\n\n\n<br>\n\n## siri唤醒电脑/查询是否开机<a id=\"myid_4\"></a>\n\n这个在外面用moonlight的时候是真用得上\n<iframe src=\"https:////player.bilibili.com/player.html?isOutside=true&aid=113014111996109&bvid=BV16eWRerEvd&cid=500001660158650&p=1&high_quality=1&danmaku=1&autoplay=0\" scrolling=\"no\" border=\"0\" frameborder=\"no\" framespacing=\"0\" allowfullscreen=\"true\" width=\"100%\" height=\"600\"></iframe>\n\n<br>\n简而言之就是一个运行sh的wol和ping服务，穷则内网穿透，达则ddns\n\n**18local.py：**\nUSERNAME = \"\"\nPASSWORD = \"\"\nTOKEN = \"\"\nKEY = \"\"\n```python\nfrom fastapi import FastAPI, UploadFile, File, Form\nimport shutil\nimport os\nfrom fastapi import FastAPI, Request, Response, HTTPException\nfrom fastapi.responses import JSONResponse\nfrom pydantic import BaseModel\nfrom typing import List\nfrom starlette.middleware.base import BaseHTTPMiddleware\nfrom starlette.responses import JSONResponse\n\n# 18本地服务器接收远端请求\nimport subprocess\nimport argparse\nimport re\n\nclass CustomError(Exception):\n    def __init__(self, message=\"A custom error occurred\"):\n        super().__init__(message)\n        self.message = message\n\nclass R:\n    def __init__(self, code: int, msg: str = None, data=None):\n        self.code = code\n        self.msg = msg\n        self.data = data\n\n    @classmethod\n    def success(cls, data):\n        \"\"\"Creates a success Response object.\"\"\"\n        return cls(code=1, data=data)\n\n    @classmethod\n    def error(cls, msg):\n        \"\"\"Creates an error Response object.\"\"\"\n        return cls(code=0, msg=msg)\n\n\ndef ping_ip(ip_address):\n    try:\n        # Run the ping command\n        result = subprocess.run([\'ping\', \'-c\', \'2\', ip_address], stdout=subprocess.PIPE, stderr=subprocess.PIPE, text=True)\n\n        # Check if the command was successful\n        if result.returncode == 0:\n            return result.stdout\n        else:\n            return f\"Error: {result.stderr},{result.stdout}\"\n    except Exception as e:\n        return str(e)\n\ndef handle_ping(ip_address):\n    # Example usage\n    output = ping_ip(ip_address)\n    if \"Destination Host Unreachable\" in output:\n        return \"not online\"\n    else:\n        match = re.search(r\'time=([\\d.]+ ms)\', output)\n        if match:\n            return \"online:\" + match.group(1)\n        else:\n            return \"error:\" + output\n\n\ndef wol(mac_address):\n  try:\n      result = subprocess.run(\n          [\'wakeonlan\', mac_address],\n          stdout=subprocess.PIPE,\n          stderr=subprocess.PIPE,\n          text=True\n      )\n      if result.returncode == 0:\n          return result.stdout\n      else:\n          return result.stdout\n  except Exception as e:\n      return e\n\n\napp = FastAPI()\n# 注册中间件\n#app.add_middleware(AuthMiddleware)\n\nUSERNAME = \"\"\nPASSWORD = \"\"\nTOKEN = \"\"\nKEY = \"\"\n\nclass UserData(BaseModel):\n    ip: str = None\n    key: str\n\n# 返回ping成功与否 online not online\n@app.post(\"/ping\")\ndef login(userdata: UserData):\n    if userdata.key == KEY and userdata.ip:\n        return R.success(handle_ping(userdata.ip))\n\n    else:\n        return R.error(\"valid key\")\n\n    \n@app.post(\"/wol\")\ndef login(userdata: UserData):\n    if userdata.key == KEY:\n        return R.success(wol(\"58:11:22:0A:DC:CD\"))\n\n    else:\n        return R.error(\"valid key\")\n```\ngunicorn文件参考<a href=\"#gunicorn_gpt5.py\">gunicorn_gpt5.py</a>\nlinux命令也是\n\n<br>\n\n## 自制网盘1<a id=\"myid_5\"></a>\n这个网盘用过一段时间以解决ipad空间不足的问题，nginx开启文件浏览，相当于廉价的nas\nbt下载用linux下的aria2相当于规避某些迅雷下不了的磁力\n设备就20块的500g机械硬盘，易驱线，40块的玩客云。\n最后好像是把usb口跑坏了，读取不到硬盘，外加没需求，就作废不搞了?\n\n<iframe src=\"https:////player.bilibili.com/player.html?isOutside=true&aid=113014413985823&bvid=BV1ysWRemEoQ&cid=500001660203142&p=1&high_quality=1&danmaku=1&autoplay=0\" scrolling=\"no\" border=\"0\" frameborder=\"no\" framespacing=\"0\" allowfullscreen=\"true\" width=\"100%\" height=\"600\"></iframe>\n\n\n<br>\n\n## 席巴商城<a id=\"myid_6\"></a>\n仓库：（到时汇总完再搞上来）\n网址：[https://www.yjztest.top/xiba-shop/home](https://www.yjztest.top/xiba-shop/home)\n\n毕设在商城和博客中选了商城，想着实在做不出就找网上或者买的话商城也多?（进可攻退可守）\n\n<iframe src=\"https:////player.bilibili.com/player.html?isOutside=true&aid=113014447606367&bvid=BV1PtWRe2EMG&cid=500001660208486&p=1&high_quality=1&danmaku=1&autoplay=0\" scrolling=\"no\" border=\"0\" frameborder=\"no\" framespacing=\"0\" allowfullscreen=\"true\" width=\"100%\" height=\"600\"></iframe>\n\n\n<br>\n\n## 旧博客<a id=\"myid_7\"></a>\n- 旧版的博客（其实写到一半就懒得搞了???），\n- 最喜欢的是那个访客表的筛选，和评论组件（新版评论改了旧版改拿去用了，筛选框就直接重新写了）\n- (乱用bootcdn导致国内奇慢?，被墙？)\n\n仓库：[h