n<!DOCTYPE mapper\n        PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\"\n        \"http://mybatis.org/dtd/mybatis-3-mapper.dtd\">\n<mapper namespace=\"com.example.demo1228_2.mapper.AllMapper\">\n    <select id=\"selectpagebyadminWithSearch_SetList\" resultType=\"map\">\n        SELECT * FROM ${biao}\n        <where>\n            <if test=\"yaunsuListMap != null and !yaunsuListMap.isEmpty()\">\n                <foreach collection=\"yaunsuListMap\" item=\"list\" index=\"key\" separator=\" AND \">\n                    <foreach collection=\"list\" item=\"map\" separator=\" OR \">\n                        ${key} = #{map.value}\n                    </foreach>\n                </foreach>\n            </if>\n        </where>\n        <choose>\n            <when test=\'value2 == \"a\"\'>\n                ORDER BY id ASC\n            </when>\n            <when test=\'value2 == \"b\"\'>\n                ORDER BY create_time DESC\n            </when>\n            <otherwise>\n                ORDER BY create_time DESC\n            </otherwise>\n        </choose>\n    </select>\n</mapper>\n\n```\n导致之前例如\n> @JsonFormat(shape = JsonFormat.Shape.STRING)\n    private Long id\n\n的注解全失效 所以就手动序列化\n\n\n```Java\nprivate void pageStringJsonSerialize(Page page){\n        page.setRecords(page.getRecords().stream().map(item->{\n            try {\n                Map<String, Object> map = objectMapper.convertValue(item, Map.class);\n                map.put(\"create_time\", map.get(\"create_time\").toString().substring(0, 19));\n                if (!ObjectUtils.isEmpty(map.get(\"update_time\")))\n                    map.put(\"update_time\", map.get(\"update_time\").toString().substring(0, 19));\n                if (!ObjectUtils.isEmpty(map.get(\"id\")))\n                    map.put(\"id\", map.get(\"id\").toString());\n                if (!ObjectUtils.isEmpty(map.get(\"user_id\")))\n                    map.put(\"user_id\", map.get(\"user_id\").toString());\n                if (!ObjectUtils.isEmpty(map.get(\"love_list\")))\n                    map.put(\"love_list\", objectMapper.readValue(map.get(\"love_list\").toString(), new TypeReference<List<String>>() {}));\n                return map;\n            } catch (Exception e) {\n                // 处理异常，比如记录日志\n                throw new RuntimeException( e);\n            }\n        }).toList());\n    }\n```\n\n','noproduct',NULL,NULL,'2024-08-25 08:00:38','1',1784369102748491777,'2024-09-09 00:37:49',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1827850322861666306,'【vue】组件加ref会导致生成两个元素的数组',NULL,0,'（某一个才是本体？）','![image.png](http://localhost:8080/img/7GAOGU_202408260727.webp)\n![image.png](http://localhost:8080/img/7E93LS_202408260727.webp)\n![image.png](http://localhost:8080/img/JKB6SS_202408260727.webp)','noproduct',NULL,NULL,'2024-08-25 23:27:31','1',1784369102748491777,'2024-09-09 00:36:24',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,0,0,NULL),(1828740500560064513,'【问题】this.$set更新子组件之后不刷新dom',NULL,0,NULL,'```JavaScript\nconst typelist = this.$refs[obj.prop][1].search_add_last_time[obj.prop]\nconst index3 = typelist.findIndex(item => JSON.stringify(item) === JSON.stringify(obj.item))\nthis.$delete(typelist, index3)// 子组件仓移除 // 移除是移除了 但没更新\nthis.$root.$emit(\'update_\'+obj.prop)\n\n```\n这里this.$refs[obj.prop][1]用[1]是因为[0]似乎是个啥observer\n\n$refs获取到的不是单个元素而是数组（包含两个对象），原因未知\n\nthis.$delete(能改变子组件的值 但是子组件dom没触发更新\n\n（ps：最后还是靠事件总线强制更新子组件?）\n等待高人解答或日后搞明白\n\n20240907\n----\n天崩了，observer难道是组件会生成的？而且不一定是[0]，也可能是[1]?\n```JavaScript\nvar typelist = this.$refs[obj.prop][1].search_add_last_time[obj.prop]\nif(!typelist)typelist = this.$refs[obj.prop][0].search_add_last_time[obj.prop]\n```\n最后就这样搞了','noproduct',NULL,NULL,'2024-08-28 10:24:46','1',1784369102748491777,'2024-09-09 00:36:14',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1829419130562834433,'小灰特辑',NULL,0,'','有天晚上睡不着去喂猫\n之前经常喂的小灰猫在下雨那天遇到了，一起在屋檐下躲雨\n（然后抱了2小时?\n\n![](https://pic3.zhimg.com/v2-5899a95cf00f9a002d4e72611f05235e_r.jpg)\n\n一起躲雨的其他大佬\n\n![](https://pic1.zhimg.com/v2-1b5573f5510f9f3f5d1a38ab28a4aaa2_r.jpg)\n\n隔了一天去时，发现他还在原地?，萎靡不振，喂东西吃也不吃，一只眼睛肿了\n就买了个航空箱给绑架到医院了\n\n![](https://pic1.zhimg.com/v2-b3427edd9b417af2a17326c4e52f7d5e_r.jpg)\n\n医生说是猫瘟，白细胞1，pcl阳?\n给他办住院了（感谢熙熙流浪猫7折）医生说才知道是母猫，一直以为是公的\n\n![](https://picx.zhimg.com/v2-cd77a16f3a60491483280d87c9d5948f_r.jpg)\n\n接回家了一晚\n\n![](https://pica.zhimg.com/v2-80606ca021b7ef683f36bc7fc60a3c3c_r.jpg)\n\n住院猫?↓\n\n![](https://pic1.zhimg.com/v2-38be8b2e75e563855bcb5fd63c272306_r.jpg)\n\n？你玩马克？\n\n![](https://pic3.zhimg.com/v2-7a81e5eb2660fe56d2700e699913ce24_r.jpg)\n\n小区其他小猫?\n\n![](https://pic2.zhimg.com/v2-7ea42bced8a7f67567001410caf7b3a3_r.jpg)\n\n病好咯出院?（放回他原来呆的地方）\n\n![](https://pica.zhimg.com/v2-217bb2350a32757ad7c9d36c5a0d1fe6_r.jpg)\n\n?\n\n![](https://pic2.zhimg.com/v2-5b4af19f97f77c6dc31957a28cded5e3_r.jpg)\n\n这个猫妈妈养了好多小猫\n\n![](https://pic3.zhimg.com/v2-07eb8703370ad02ba50772a9b1cd8434_r.jpg)\n\n11\n\n![](https://pic2.zhimg.com/v2-af8e3d72d7f14b5182ba8f3a46a76fe1_r.jpg)\n\n![](https://picx.zhimg.com/v2-72aaab4933fd3bd23f9063c096b7fa6f_r.jpg)\n\nEND\n---\n\n240831后记\n---\n状告渣女小灰?把小区的公猫迷的鬼迷心窍(~~不包括我~~) 有时去喂他 公猫就哈我??\n一天换一个公猫?\n看到我向我跑来，吃饱了抹嘴就溜??一刻不留\n该不会还在记恨我带他打针吧?（当时她嗷的贼大声，笑死）\n综上，渣女小母猫小灰！?还我2k大洋（果然欠钱的是大爷）\n\n还是小白好（老白）?作为白猫 猫届的最底层（无配偶权，~~和某人一样~~）\n看到我就整天跟着我（跟着我也不给吃的?）?为父很欣慰\n以后多去喂你这个逆子','noproduct','https://pic2.zhimg.com/v2-5b4af19f97f77c6dc31957a28cded5e3_r.jpg',NULL,'2024-08-29 23:21:24','4',1784369102748491777,'2024-09-09 00:45:08',1,2,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,1,NULL),(1829426131275640834,'Macao',NULL,0,NULL,'![](https://pic3.zhimg.com/v2-4a2acc659a2fb87a7c796c2d5f215c02_r.jpg)\n\n传说中的巴黎人，我穿着人字拖进去逛 属实是乡下人进城了?\n![](https://pic1.zhimg.com/v2-b12f1f7b24a47a98ac5d68ffd7f08820_r.jpg)\n\n比天环的SHAKE SHACK好吃??\n\n![](https://pic4.zhimg.com/v2-2d70f76dc2ec4072023d54c2d69433e3_r.jpg)\n\n口岸附近的楼，属实是赛博朋克色调\n\n![](https://picx.zhimg.com/v2-185a7b76203328b362097789387e1f65_r.jpg)\n\n小时候喝的柠檬茶，后来没得卖了好像，这里还有\n\n![](https://pic4.zhimg.com/v2-9d413a46a00c422ab3a5efe2