7cb4dfa71477a7453aff39f7acadc_r.jpg)\n![](https://pic3.zhimg.com/v2-713a2b9418f2760b2e611bd0a38c2a1a_r.jpg)\n这个大耗子?脾气也忒大 摸的不舒服就假咬吓我 傲娇灰\n别人家小白怎么摸都不反抗??','noproduct','https://pic1.zhimg.com/v2-fca7cb4dfa71477a7453aff39f7acadc_r.jpg',NULL,'2024-09-12 17:50:05','4',1784369102748491777,'2024-09-12 17:50:05',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1834237100447268865,'【nginx】本地文件浏览乱码',NULL,0,NULL,'```nginx\n    location /abc/{\n      root G:;                              # 根目录\n      autoindex on;                         # 开启目录浏览功能\n      autoindex_exact_size off;             # 关闭详细文件大小统计\n      autoindex_localtime on;               # 以本地时区显示文件修改时间\n  }\n```\n> 这里最后实际http://localhost/abc/路径请求的是G:\\abc\\路径下的文件(root G:)\n\n由于电脑是gbk编码 导致文件最后读取路径是\nhttp://localhost/share/%5B%D1%B8%C0%D7%CF%C2%D4%D8www.2tu.cc%5D%D0%C2%CA%C0%BC%CD%B8%A3%D2%F4%D5%BD%CA%BF%D0%C2%BE%E7%B3%A1%B0%E6.%C6%C6.BD1024%B3%AC%C7%E5%C8%D5%D3%EF%D6%D0%D7%D6.mkv\n\n又因为不想改变电脑编码 导致无法用中文文件，等待时间解答','noproduct',NULL,NULL,'2024-09-12 22:26:18','9',1784369102748491777,'2024-09-12 22:26:18',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1834993770874068994,'关于本博客',NULL,0,NULL,'## 一些导航\n- [关于我](./about)\n- [关于本博客](./product?id=1834993770874068994)\n- [关于项目](./product?id=1826979706201747458)\n\n## 关于本博客\n- 一些个人日常分享，图片视频展示?\n- 文章权限分为首页可见，分类可见，隐藏\n- 分类可见只能在点开分类后查看到该文章（首页搜索不到）\n- 归档页显示全文章\n- 一个文章只有一个分类，但有多个标签\n- 关闭注册，开放微信扫码登录，邮箱登录\n- 基于vue2 springboot\n- 源码：[https://github.com/hhhhhhos/NewBlog](https://github.com/hhhhhhos/NewBlog)\n\n\n\n## 为什么要做这个博客\n- 因为cs找工作都要求有些什么项目，但是没工作怎么有项目?（先有鸡还是先有蛋的问题）\n- 装13\n- do sth\n- 日记或记录，维持心理健康，变相和过去或未来的自己对话\n- 没事干\n\n\n\n## 最后\n- 以上内容纯属无聊瞎笔笔，如有雷同纯属雷同\n\nEND\n---\n','noproduct',NULL,NULL,'2024-09-15 00:33:02','7',1784369102748491777,'2024-09-16 05:40:59',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1835283090621190146,'关于本博客（原版）',NULL,0,NULL,'## 一些导航\n- [关于我](./about)\n- [关于本博客](./product?id=1834993770874068994)\n- [关于项目](./product?id=1826979706201747458)\n\n## 关于本博客\n- 一些个人日常分享，图片视频展示?\n- 文章权限分为首页可见，分类可见，隐藏\n- 分类可见只能在点开分类后查看到该文章（首页搜索不到）\n- 归档页显示全文章\n- 一个文章只有一个分类，但有多个标签\n- 关闭注册，开放微信扫码登录，邮箱登录\n- 基于vue2 springboot\n\n\n## 为什么要做这个博客\n- 因为cs找工作都要求有些什么项目，但是没工作怎么有项目?（先有鸡还是先有蛋的问题）\n- 装13\n- do sth\n- 日记或记录，维持心理健康，变相和过去或未来的自己对话\n- 不用上班 没事干（我个人认为，在合法不伤害他人，不上班也能维持正常生活水平的情况下，你可以做你想做的事->指不违法不伤害他人的事，包括上班?）\n\n## 说到上班\n\n- 之前有一份别人眼中还行的工作，但是那个工作反而降低了我的生活水平，身体健康和身心健康都受到一定影响，遂跑路\n- 我认为不上班最大的问题只有三个，**1.钱 2.社交 3.身份认同**\n- 一些985硕士，或者王某聪等富二代等不上班，纯粹是不怕社会观念对自己的内耗，因为自己已经成为别人内耗的对象，身份认同的上层，社会观念洗脑无法制裁他们\n- 只要你和你的小学/初中/高中/大学/同事有线上或线下的接触，社会观念和内耗就会产生，不上班是社会身份认同里排名最低下的（虽然很爽?）\n- 自然作为身份认同最低下的无业游民，社交自然会慢慢断绝，人出校园之后一般和同事同阶级人群交往，高低无法兼容，高者愿意向下兼容例外，低者向上会内耗，高低可能会互相阴阳。（个人想法，如有雷同纯属雷同）\n- 个人认为除非社会观念一夜之前被集体洗脑，不然内耗不会消除，内卷不会停止（不在乎社会观念者除外，当然大部分人非圣贤，90%在乎）\n\n## 不上班有解吗\n- 无解?，我认为最优解是找个轻松，有身份认同的班/学上\n- 断绝大部分往来也许会减轻/加重内耗?反正我已经给耗到不行，卷又卷不过，躺又躺不平\n- 我承认钱和社交勉强有解，身份认同这个真无解，我目前投降了，无法给自己洗脑成功，只能被社会洗脑\n- 目前也是躲到了某个非无业游民的社会身份里，有一定认同度（不高不低），（一直想要的身份，最终还是花钱买了身份）没身份就会被家人朋友 和社会观念毒打\n- 西方政党塑造的主流是麻子??，彩虹?，0元购，真好??，没内耗\n- 结果就是身份暂时还挺爽??，有大部分时间自己想做啥做啥，就是有点担心?身份有丢失的风险，有考核\n- 有多少人羡慕李白，也许不只是羡慕他有个有钱的爹，还羡慕他有不惧社会观念的勇气，但李白真的开心吗，又有多少人真的希望当李白呢\n\n\n## 一些碎碎念\n- 额，也不知道说啥，其实我也懒得做了，只是电子养胃又不知道做啥?，没事做就当消磨时间了。\n- 一开始是想着炫技~~装13~~，但后来发现人外有人，天外有天，一茬又一茬的人会去学一茬又一茬的人创造的一茬又一茬的新技术?，无限循环，干脆就学到某个时间点创造的技术框架就不学了?~~就是懒~~\n\n## 最后\n- 以上内容纯属无聊瞎笔笔，如有雷同纯属雷同，个人观点仅供参考。\n\n\nEND\n---','noproduct',NULL,NULL,'2024-09-15 19:42:41','7',1784369102748491777,'2024-09-15 19:42:41',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,0,0,NULL),(1837403720137170945,'??小灰不见啦！',NULL,0,'??我的大耗子哪去了','??555我的小灰，我的大耗子??你是嘎了还是被人抱走了\n之前台风天，他一直躲在居民楼1楼\n最近去那连续一周都没有找到他????谁把我的小灰抱走了 还我小灰！?\n家里不是很支持养，所以之前我也没带回来\n下次撞见一定拿回家！！????\n我不会再也见不到他，只能在图片视频里回忆他了吧??\n\n![](https://pica.zhimg.com/v2-c3ceee9bc501238527167ee3cb7a5628_r.jpg)\n\n\n\n![](https://pic1.zhimg.com/v2-12125499206bbeb675b454f3631932b8_r.jpg)\n\n\n\n![](https://picx.zhimg.com/v2-5232116f8fa0590256e6d8808bb52949_r.jpg)\n\n\n\n![](https://pic3.zhimg.com/v2-5b7442c0ea5c0f9350da6872bce75566_r.jpg)\n\n\n\n![](https://picx.zhimg.com/v2-ca5aa1f6bbe95aa9d27df93e36f9e31b_r.jpg)\n\n\n\n![](https://pica.zhimg.com/v2-3fcc85b7d3f36a70f7963bf016c3ce7a_r.jpg)\n\n\n\n![](https://pica.zhimg.com/v2-956207c012aed9b149920b3686e9555a_r.jpg)\n\n\n\n![](https://pica.zhimg.com/v2-37102be4917f17655c7f0ccdc9d40912_r.jpg)\n\n\n\n![](https://picx.zhimg.com/v2-44ef2f4633742693b9b3f92f2f3af277_r.jpg)','noproduct','https://pica.zhimg.com/v2-c3ceee9bc501238527167ee3cb7a5628_r.jpg',NULL,'2024-09-21 16:09:19','4',1784369102748491777,'2024-09-21 16:30:32',1,23,0,0.00,0,NULL,NULL,'[1784369102748491777, 1765383973137141762]',NULL,NULL,0,1,1,NULL),(1837673058580684801,'Action表思路',NULL,0,NULL,'- 有些类型是用户作用于某个表 就\nuser_id,receiver_id   biao_id_user(不需要),biao_id_receiver,(被biao_id替代？)\n- 一开始是用json存的评论 信息，后面打算实时通过\nbiao_id_user  , biao_id_receiver,从biao获取，动态加入VO，删除时前端显示已删除\n- setUser setBiao_obj 记得补充在 actioncontroller\n\n- comment评论有三个层级，父 子 子子，（子子是回复子或子子，有replay_to_）\n```Java\n            Comment comment = new Comment();\n            comment.setProduct_id(product_id);\n            comment.setIs_show(true);\n            comment.setFather_comm_id(father_comment_id); // 子有值\n            comment.setUser_id(Tool.getUserSessionId(session));\n            comment.setReplay_to_user_id(replay_to_user_id); // 只在子子有值\n            comment.setReplay_to_comm_id(replay_to_comm_id); // 只在子子有值\n\n```\n父是文章下直接评论，子是直接评论下的，子子是回复子或子子的。\n\n- 去重是通过验证\n```Java\nif(!Db.lambdaQuery(Action.class)\n                .eq(Action::getUser_id,user_id)\n                .eq(Action::getReceiver_id,obj.getUser_id())\n                .eq(Action::getType,\"product_zan\")\n                .eq(Action::getBiao_id_user,obj.getId())\n                .exists()){\n            actionMapper.insert(action);\n        }\n```\n有些是用.eq(Action::getBiao_id,obj.getId())历史遗留问题\n如果Biao_id为空的话 就会永远不存在 导致去重失败\n\n','noproduct',NULL,NULL,'2024-09-22 09:59:34','1',1784369102748491777,'2024-09-23 09:52:34',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1838089664418807809,'【BLOG】上线之和GPT大探讨内存限制',NULL,0,'还有sql表','[https://chatgpt.com/share/66f0fdcb-19b0-8004-8b8d-82896ba6b74d](https://chatgpt.com/share/66f0fdcb-19b0-8004-8b8d-82896ba6b74d)\nnohup java -Xmx150m -XX:+HeapDumpOnOutOfMemoryError -XX:HeapDumpPath=./ -jar shop0.1.jar > logName.log 2>&1 &\n\nnohup java -Xmx200m -XX:+HeapDumpOnOutOfMemoryError -XX:HeapDumpPath=./ -jar newblog0.4.jar --server.port=8006 > logName.log 2>&1 &\n\n[root@VM-8-17-centos a-xiba-newblog-back]# cat /var/log/syslog | grep -i \"kill\"\n[1]+  Killed                  nohup java -XX:+HeapDumpOnOutOfMemoryError -XX:HeapDumpPath=./ -jar newblog0.4.jar --server.port=8006 > logName.log 2>&1\n\nmysql -u yjz -p newblog < new_blog_without_data.sql\n\n','noproduct',NULL,NULL,'2024-09-23 13:35:01','1',1784369102748491777,'2024-09-23 13:35:01',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL),(1838170795306647554,'fenlei_map[key]和fenlei_map.key区别',NULL,0,'只能说GPT真是天才','```JavaScript\nconst fenlei_map = {\n  \"001\": \"分类A\",\n  \"002\": \"分类B\",\n  \"003\": \"分类C\"\n};\n\nconst key = \"001\";\n\n// 正确的访问方式：使用 fenlei_map[key]，会根据 key 的值（\"001\"）来动态获取 \"分类A\"\nconsole.log(fenlei_map[key]); // 输出 \"分类A\"\n\n// 错误的访问方式：使用 fenlei_map.key，JavaScript 会寻找名为 \"key\" 的属性，而不是使用变量的值\nconsole.log(fenlei_map.key); // 输出 undefined，因为 fenlei_map 中没有名为 \"key\" 的属性\n\n```\n','noproduct',NULL,NULL,'2024-09-23 18:57:24','1',1784369102748491777,'2024-09-23 18:57:24',1,0,0,0.00,0,NULL,NULL,NULL,NULL,NULL,0,1,0,NULL);
